        protected void Page_Load(object sender, EventArgs e)
        {
            if (!IsPostBack)
            {
                norec.Visible = false;
                CheckIsLogin();
                
            }
        }
        protected void CheckIsLogin()
        {
            if (Session["is_login"] != null)
            {
                if (Session["is_login"].ToString() == "f")
                {
                    Response.Redirect("~/Login");
                }
                else
                {
                    state_id = int.Parse(Session["state"].ToString());
                    lblelection.Text = Session["election"].ToString();
                    lblstate.Text = Session["statename"].ToString();
                    fill_can(state_id);

                }
            }
            else
            {
                Response.Redirect("~/Login");
            }
        }
        public void fill_can(int wid)
        {

            objBus.state_id = state_id;
            DataSet ds = objBus.fill_calon_candidates();
            if (ds.Tables[0].Rows.Count  == 0)
            {
                norec.Visible = true;
            }
            else
            {
                string id1 = ds.Tables[0].Rows[0]["area_id"].ToString();
                string id2 = ds.Tables[2].Rows[0]["area_id"].ToString();
                string id3 = ds.Tables[1].Rows[0]["#"].ToString();
                string id4 = ds.Tables[3].Rows[0]["#"].ToString();
                datalstParlimenname.DataSource = ds.Tables[0];
                datalstParlimenname.DataBind();
            }
        }
       
        protected void datalstParlimenname_ItemDataBound1(object sender, DataListItemEventArgs e)
        {
            if ((e.Item.ItemType == ListItemType.Item) || (e.Item.ItemType == ListItemType.AlternatingItem))
            {
                DataTable lstPar = new DataTable();
                string cand_imaged;
                lstPar.Columns.Add("#", typeof(string));
                lstPar.Columns.Add("name", typeof(string));
                lstPar.Columns.Add("image", typeof(string));
                lstPar.Columns.Add("party_shortcode", typeof(string));
                lstPar.Columns.Add("icnum", typeof(string));
                lstPar.Columns.Add("dob", typeof(string));
                lstPar.Columns.Add("age", typeof(string));
                lstPar.Columns.Add("religion", typeof(string));

                DataRowView drv = e.Item.DataItem as DataRowView;
                DataList datalstParlimen = e.Item.FindControl("datalstParlimen") as DataList;
                DataTable tempdt = new DataTable();
                tempdt = drv.CreateChildView("parlimenRelation").ToTable();

                DataRowView drv_dun = e.Item.DataItem as DataRowView;
                DataList datalstDunname = e.Item.FindControl("datalstDunname") as DataList;
                datalstDunname.DataSource = drv_dun.CreateChildView("parlimenDunRelation");

                if (tempdt.Rows.Count > 0)
                {
                    for (int i = 0; i < tempdt.Rows.Count; i++)
                    {
                        string base64Stringd = "";
                        if (tempdt.Rows[i]["image"].ToString() == "")
                        {
                            base64Stringd = "";
                        }
                        else
                        {
                            byte[] bytesd = (byte[])tempdt.Rows[i]["image"];
                            if (bytesd.Length > 0)
                            {
                                base64Stringd = Convert.ToBase64String(bytesd, 0, bytesd.Length);
                            }
                            else
                            {
                                base64Stringd = "";
                            }
                        }
                        cand_imaged = "data:image/png;base64," + base64Stringd;
                        lstPar.Rows.Add(tempdt.Rows[i]["#"].ToString(), tempdt.Rows[i]["name"].ToString(), cand_imaged, tempdt.Rows[i]["party_shortcode"].ToString(),
                            tempdt.Rows[i]["candidate_ic"].ToString(), tempdt.Rows[i]["dob"].ToString(), tempdt.Rows[i]["age"].ToString(),tempdt.Rows[i]["lookup_name"].ToString());
                    }
                    datalstParlimen.DataSource = lstPar;
                    datalstParlimen.DataBind();
                    datalstDunname.DataBind();
                }
            }
        }
